import React, {Component} from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

class assignmentTracker extends Component {
  constructor() {
      super()
      this.state= {
         assignmentsJSON : [],
         headerImg: "https://poster.keepcalmandposters.com/8738135.jpg"
      }
  }

  componentDidMount() {
      fetch("https://beehiveapi.lionhearttrust.org.uk/v3.5/planner/test/assignments?pageIndex=0&pageSize=20").then(response => response.json()).then(response => {
          const {assignments} = response.data
          this.setState({
              assignmentsJSON: assignments
          })
      })
  }

  render() {
      return (
          <div>
              <header>
                  <img src={this.state.headerImg} alt="Keep Calm and Do Your Assignment" />
                  <h1>Homework Assignment Tracker</h1>
              </header>



          </div>
      )
  }
}







ReactDOM.render(
  <assignmentTracker />,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
